public class L914XofKindInDeck {

    public static void main(String[] args) {
        new L914XofKindInDeck().run();
    }

    public void run(){
        System.out.println(hasGroupsSizeX(new int[]{1,1,1,2,2,2,3,3}));
    }

    public boolean hasGroupsSizeX(int[] deck) {

        Map<Integer, Integer> freqMap = new HashMap<>();

        for( int i = 0; i < deck.length; i++ ){
            if( !freqMap.containsKey(deck[i]) ){
                freqMap.put(deck[i], 0);
            }

            freqMap.put(deck[i], freqMap.get(deck[i])+1);
        }

        int gcd = 0;

        for( int key: freqMap.keySet() ){
            if( freqMap.get(key) < 2 ) return false;

            gcd = gcd(freqMap.get(key), gcd);
        }

        if( gcd == 1 ) return false;

        for( int key: freqMap.keySet() ){

            if( (freqMap.get(key) % gcd) != 0 ) return false;
        }

        return true;

    }

    int gcd(int a, int b) {
        return b == 0 ? a : gcd(b, a % b);
    }
}
